  \"Summary of residue analysis of biota collected for the Department of the Interior:
  Reconnaissance investigation of irrigation drainage in the San Juan River area,
  northwestern New Mexico\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:42:21.894679\",\n\t\"name\": \"summary-of-residue-analysis-of-biota-collected-for-the-department-of-the-interior-reconnai\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"There were three primary objectives of
  this reconnaissance study. These objectives were: (1) to determine if DOI-sponsored
  irrigation projects contribute to contamination in the San Juan River area, and
  if so, what part of the entire contamination problem is attributable to DOI-sponsored
  irrigation activities; (2) to determine which of the DOI-sponsored irrigation projects
  are the source of contamination; and (3) to determine if and to what degree human
  health and wildlife are affected by contamination contributed by DOI-sponsored irrigation
  activity, both on the irrigation projects and on adjacent lands and waters.\",\n\t\"license_title\":
